import React,{ Component } from "react";
import logo from './logo.svg';
import './App.css';
import FirstDisplay from './LandingPage/firstDisplay';
import OurService from './LandingPage/OurService';
import ThirdDisplay from './LandingPage/thirdDisplay'
import FourthDisplay from './LandingPage/fourthDisplay';
import FifthDisplay from './LandingPage/fifthDisplay';
import SixthDisplay from './LandingPage/sixthDisplay';

import Navigation from './Navigation';
import bottomNavigation from './bottomNavigation';

function App() {
  return (
    <div className="App">
      <Navigation/>
      <FirstDisplay/>
      <OurService/>
      <ThirdDisplay/>
      <FourthDisplay/>
      <FifthDisplay/>
      <SixthDisplay/>
      <bottomNavigation/>
    </div>
  );
}

export default App;
